import Image from "./123.png";
import Image1 from "./brand.jpeg";
import './logo.css';

function Logo() {
    return (
        <div className="brandhub_header">
      <a className="benz_logo" target="_self" tabindex="0" aria-hidden="true">
        <img src="logo.svg" alt="logo not found" />
        <img src="brand-without-claim.svg" className="brand_name" alt="brand name not found" />
      </a>
    </div>
    );
}

export default Logo;
